import React from 'react'

const TodoItem = (props) => {
    
    let onChange = props.OnChange;
    let id = props.id;
    const OnCheckChange2 = (id) => {
        onChange(id);
    }

    return (
        <div>
            <li>
                <input type="checkbox" onChange={() => { OnCheckChange2 }} />
                <strong>{props.id}</strong>
                {props.name}
                <button>&times;</button>
            </li>
        </div>
    )
}
export default TodoItem;
